import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import HomeScreen from './src/screens/HomeScreen'

const Tab = createBottomTabNavigator();

function TopTabNavigator() {
 return (
    <Tab.Navigator>
      <Tab.Screen name="Screen1" component={HomeScreen} options={{headerTitleStyle: {display: 'none'}, headerShown: false}}  />
      <Tab.Screen name="Screen2" component={HomeScreen} />
      <Tab.Screen name="Screen3" component={HomeScreen} />
    </Tab.Navigator>
 );
}

const Stack = createStackNavigator();

export default function App() {
 return (
    <NavigationContainer>
      <Stack.Navigator>
      <Tab.Screen name="Screen1" component={HomeScreen} options={{headerTitleStyle: {display: 'none'}, headerShown: false}}  />
        <Stack.Screen name="TopTabNavigator"  component={TopTabNavigator} />
      </Stack.Navigator>
    </NavigationContainer>
 );
}
